var NUMBER_PATTERN=/([0-9]+)/;function naturalCompare(t,r){var n,e,a,l,p=(""+t).split(NUMBER_PATTERN).map(tryParseInt),s=(""+r).split(NUMBER_PATTERN).map(tryParseInt);for(a=0,l=Math.min(p.length,s.length);a<l;a++)if((n=p[a])!=(e=s[a]))return n>e?1:-1;return p.length>s.length?1:p.length==s.length?0:-1}function tryParseInt(t){return""+parseInt(t)==t?parseInt(t):t}module.exports=naturalCompare;